import React from 'react';
import { Box, useColorModeValue, Center } from '@chakra-ui/react';
import {
  FaFacebookF,
  FaLinkedinIn,
  FaGithub,
  FaMailBulk,
} from 'react-icons/fa';

import Header from '../Components/Header';
import ButtonGroup from '../Components/ButtonGroup';

const Contact = () => {
  const bg = useColorModeValue('blue', 'yellow');
  return (
    <Box>
      <Header title="Contact" description="Say Hi" />
      <Center mb={10}>
        <ButtonGroup bg={bg} name={<FaFacebookF />} />
        <ButtonGroup bg={bg} name={<FaLinkedinIn />} />
        <ButtonGroup bg={bg} name={<FaGithub />} />
        <ButtonGroup bg={bg} name={<FaMailBulk />} />
      </Center>
    </Box>
  );
};

export default Contact;
